import { useState } from "react"
import { ORIGINAL_SVG } from "../utils/defaults"

const useSvg = () => {

    const [svgString, setSvgString] = useState<string | null>(ORIGINAL_SVG)



    return [svgString, setSvgString]

}

export default useSvg
